import React from "react";
import { useFormik } from "formik";
import "./Createjar.css";
import { Link } from "react-router-dom";
import bottlewnap from "./image/bottlewnap.png";

function Createjar() {
  const formik = useFormik({
    initialValues: {
      name: "",
    },
    onSubmit: (values) => {
      console.log("Form data", values);
    },
  });

  return (
    <>
      <div className="maincreatejar">
        <div className="createjar-left"></div>
        <div className="createjar-right">
          <form onSubmit={formik.handleSubmit}>
            <lable htmlFor="name">Name your Jar</lable>
            <input
              type="text"
              placeholder="name of your jar..."
              id="name"
              name="name"
              onChange={formik.handleChange}
              value={formik.values.name}
            />

            <button type="submit">
              <Link to="/createcookie">Next</Link>
            </button>
          </form>
        </div>
      </div>
    </>
  );
}
export default Createjar;
